import './login.styles.scss';

const Login = () => {
  return (
    <article className="login-article">
      <main className="login-main">
        <div className="login-measure">
          <fieldset className="login-fieldset">
            <legend className="login-legend"></legend>
          </fieldset>
        </div>
      </main>
    </article>
  );
};

export default Login;
